import React from "react";

import emojipedia from "../emojipedia";

function Emoji(params) {
    return <div className="term">
       <dt>
            <span className="emoji" role="img" aria-label="Tense Biceps">
              {params.emoji}
            </span>
        
          </dt>
        
          <dd>
              {params.meaning}
          </dd>
    </div>
}

export default Emoji
